EVO MG 80W90 GL-4 – универсальное всесезонное трансмиссионное масло, созданное с применением высококачественных минеральных базовых масел и пакета присадок последнего поколения. Предназначено для трансмиссий, работающих в нормальных условиях. Масло применяется в различных типах механических коробок передач, некоторых ведущих мостах, коробках отбора мощности и вспомогательных редукторах, где производитель рекомендует смазочный материал класса API GL-4.
ПрименениеEVO MG 80W90 GL-4 – используется для легковых автомобилей, лёгких грузовиков, тягачей, автобусов и строительной техники. Обладает защитой от износа, температурной стабильностью, устойчивостью к сжатию, высокой сопротивляемостью к окислению, коррозии и ржавчине, а также содержит пакет присадок, который предотвращает пенообразование и обеспечивает стабильную вязкость при высоких температурах. Это масло абсолютно нейтрально по отношению к металлам и уплотнительным материалам.
Преимущества

Обеспечивает отличное смазывание благодаря безупречным свойствам против образования пены;
Продлевает срок действия оборудования, работающего в тяжелых условиях (HD) предотвращая появление ржавчины и коррозии;
Обеспечивает отличную работу оборудования благодаря высокому индексу вязкости и свойствам герметизации.
